UnsupportedNamespace = ਨਾਂ-ਥਾਂ "%S" ਸਹਿਯੋਗੀ ਨਹੀਂ ਹੈ। "http://www.mozilla.org/2002/soap/security" ਇਸਤੇਮਾਲ ਕਰੋ।
UnknownRootElement = ਰੂਟ (root) ਐਲੀਮੈਂਟ "%S" ਪਛਾਣਿਆ ਨਹੀਂ ਗਿਆ ਹੈ। "webScriptAccess" ਐਲੀਮੈਂਟ ਇਸਤੇਮਾਲ ਕਰੋ।
UnknownElement = ਐਲੀਮੈਂਟ"%S" ਪਛਾਣਿਆ ਨਹੀਂ ਹੈ
UnknownAttribute = ਗੁਣ  "%S" ਪਛਾਣਿਆ ਨਹੀਂ ਹੈ
TooManyElements = "%S" ਐਲੀਮੈਂਟ ਤੋਂ ਵੱਧ ਸੰਭਵ ਨਹੀਂ  ਹੈ
ElementHasSibling = "%S" ਐਲੀਮੈਂਟ ਵਿੱਚ "%S" ਸਿਬੀਲਿੰਗ ਨਹੀਂ ਹੋ ਸਕਦਾ।
ElementNotEmpty = "%S" ਐਲੀਮੈਂਟ ਖਾਲੀ ਹੋਣਾ ਚਾਹੀਦਾ ਹੈ।
SOAPFault = SOAP { %S } %S ਨੇ ਗਲਤੀ ਦਿੱਤੀ ਹੈ: { %S } %S : %S

